import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Students from "./components/Students"

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="students" element={<Students />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
